INSERT INTO `a_scenic_spot` (`id`, `create_by`, `create_time`, `del_flag`, `update_by`, `update_time`, `address`, `content`, `image`, `open_time`, `price`, `title`, `type`, `url`) VALUES
	('1613456814429573120', 'admin', '2023-01-12 16:44:15.829000', 0, NULL, NULL, '海口市', '三亚最早开发的滨海度假区，餐饮和居住，环境成熟，交通方便，海滨浴场全免费开放，海上游乐项目繁多，酒店大众化，晚上沙滩沿海岸都是放着音乐的沙沙滩吧，还可以放烟花，可以吃到酒店露天经营的沙滩烧烤', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867080327204864.png', '早八晚五', 10.00, '大东海', '四星级景点', 'https://www.cncn.com/piao/hainan/'),
	('1613456814429573121', 'admin', '2023-01-12 16:44:15.829000', 0, NULL, NULL, '三亚市', '位于三亚市保亭黎族苗族自治县三道镇。有雨林谷、梦幻谷、三道谷景区组成，可以看到原生态的热带雨林景观，雨林谷和梦幻谷以黎苗族文化为主题，结合热带雨林峡谷流水的自然景观，展现原始风光和民俗风情。景区有海南最长的高空观光索道高空滑索', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867083393241088.png', '早八晚五', 400.00, '呀诺达雨林', '三星级景点', 'https://www.cncn.com/piao/hainan/'),
	('1613456814429573122', 'admin', '2023-01-12 16:44:15.829000', 0, NULL, NULL, '三亚市', '位于海南省海口市龙华区长堤路与新华北路交叉口。骑楼遍布在海口新华路、中山路、长堤路等多个街道，距今90多年的历史，是历史文化名街。大大小小有600多栋几层楼高的小楼，是上个世纪南洋归来的华侨，借鉴南洋风格建筑返乡所建，德胜沙路是海南最大的服装批发市场，新华南路有传统的裁缝店，服装鞋店，茶楼，小食店等', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867084538286080.png', '早八晚五', 50.00, '海口骑楼老街', '二星级景点', 'https://www.cncn.com/piao/hainan/'),
	('1613456814429573123', 'admin', '2023-01-12 16:44:15.829000', 0, NULL, NULL, '海口市', '海南省三亚市海棠区。海棠湾与亚龙湾、大东海湾、三亚湾、崖洲湾，并列三亚五大名湾，风光旖旎，幽静安逸，这里还没有染上城市喧嚣，人相对较少，适合赛摩托艇和潜水，还有全球最大的免税店，海南三亚海棠湾免税店', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867085490393088.png', '早八晚五', 20.00, '海棠湾', '四星级景点', 'https://www.cncn.com/piao/hainan/'),
	('1613456814429573124', 'admin', '2023-01-12 16:44:15.829000', 0, NULL, NULL, '三沙市', '位于海南省三亚市海棠区海棠湾镇。悠闲的渔村氛围，富有特色的渔民生活，地道生猛的海鲜食材等是后海渔村的特点，后海与北面的蜈支洲岛遥相辉映，每天从海上望去一片宁静祥和的风景', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867086249562112.png', '早八晚五', 10.00, '后海村', '三星级景点', 'https://www.cncn.com/piao/hainan/'),
	('1613456814429573125', 'admin', '2023-01-12 16:44:15.829000', 0, NULL, NULL, '三亚市', '因黎族青年和美丽神鹿的传说而得名，现在神话中的猎人和鹿女已雕塑成鹿回头巨型石雕，高12米，长9米，屹立在高峻的鹿回头山顶上。三亚市因此而得名鹿城。这里还是三亚城区的制高点，在这里可以看到三亚全景。', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867087088422912.png', '早八晚五', 15.00, '鹿回头', '四星级景点', 'https://www.cncn.com/piao/hainan/'),
	('1613456814429573126', 'admin', '2023-01-12 16:44:15.829000', 0, NULL, NULL, '海口市', '是一座活着的黎苗古城。景区内有崖州古街、爱情街、千古情亲子乐园、高科技体验馆，戏水区、千古情客栈等数10个主题区，雨晴皆宜，老少同乐。主秀《三亚千古情》是值得一看的演出。', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867087784677376.png', '早八晚五', 50.00, '三亚千古情', '四星级景点', 'https://www.cncn.com/piao/hainan/'),
	('1613456814429573130', 'admin', '2023-01-12 16:44:15.829000', 0, NULL, NULL, '三沙市', '海南岛第一高峰，海拔1867米，因形如五指而得名，五指山有几块保存完好的热带原始森林，是最丰富的物种基因库之一。山上终年云遮雾绕山顶，扑朔迷离，这里的山寨保存着浓郁的黎、苗族民族风情。', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867088631926784.png', '早八晚五', 50.00, '五指山', '五星级景点', 'https://www.cncn.com/piao/hainan/'),
	('1613456814429573131', 'admin', '2023-01-12 16:44:15.829000', 0, NULL, NULL, '三亚市', '位于海南三亚市海棠区海棠北路。亚特兰蒂斯的神话在这个非凡的水下展览馆得到了还原，迷宫般的隧道可以欣赏水下景观，还能通向亚特兰蒂斯的废墟。游客们有机会探寻古亚特兰蒂斯人那神秘而古老的生活方式，可以与8万多尾超过280多种海洋动物近距离接触。', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867089605005312.png', '早八晚五', 500.00, '特兰蒂斯水族', '三星级景点', 'https://www.cncn.com/piao/hainan/'),
	('1613456814429573132', 'admin', '2023-01-12 16:44:15.829000', 0, NULL, NULL, '海口市', '位于三亚市崖城镇南山村。南山海上观音坐落在南山文化旅游区，南海观音巨型铜像高108米，是世界上第1座耸立于海上的观音像，也是世界上最高大的海上塑像建筑物。', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867090607443968.png', '早八晚五', 20.00, '南山海上观音', '四星级景点', 'https://www.cncn.com/piao/hainan/'),
	('1613456814429573133', 'admin', '2023-01-12 16:44:15.829000', 0, NULL, NULL, '三沙市', '海口这座火山群地质公园内有距今100万年间火山爆发所形成的死火山口群，许多人是奔着这座公园的马鞍岭火山口去的，岭上的观海亭是火山口的最佳观测点，15分钟就能徒步上顶，一眼望去还能尽揽琼州海峡风光。另外，那里还有两类特产——火山岩矿泉水和石山羊。', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867091375001600.png', '早八晚五', 5.00, '火山群世界地质公园', '五星级景点', 'https://www.cncn.com/piao/hainan/'),
	('1613456814429573134', 'admin', '2023-01-12 16:44:15.829000', 0, NULL, NULL, '海口市', '总面积71公顷，是独具热带海滨生态园林特色的大型城市公共绿地广场，观赏植物园林与海蓝天、碧海，现代化高楼大厦融为一体，是海口市内的休闲娱乐中心。', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867091903483904.png', '早八晚五', 50.00, '万绿园', '二星级景点', 'https://www.cncn.com/piao/hainan/'),
	('1613456814429573135', 'admin', '2023-01-12 16:44:15.829000', 0, NULL, NULL, '三亚市', '位于海南岛陵水县新村镇望海大道。呆呆岛沙滩海岸线全长5.9公里，是海南岛东海岸线最长的保护最好的绝美沙滩，是海南十大浪漫景区之一，原生态静谧。岛上可看到不同的房车，各式古船和近百张七彩的沙滩椅，既原汁原味又浪漫多姿。', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867092595544064.png', '早八晚五', 10.00, '呆呆岛', '三星级景点', 'https://www.cncn.com/piao/hainan/'),
	('1613456814429573136', 'admin', '2023-01-12 16:44:15.829000', 0, NULL, NULL, '儋州市', '因其景区两边森林峻峭，中间是一条延绵几千米的槟榔谷地，故称槟榔谷，景区内分为原甘什黎村、原生态苗寨，神秘雨林等多个景区，在这里可以了解到黎族文化发展，黎族的发展历史，苗族的蚩尤文化。', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867093061111808.png', '早八晚五', 50.00, '槟榔谷', '四星级景点', 'https://www.cncn.com/piao/hainan/'),
	('1613456814429573137', 'admin', '2023-01-12 16:44:15.829000', 0, NULL, NULL, '三亚市', '位于文昌市东郊镇海滨半岛。这里椰树成片，有红椰、青椰、良种矮椰、高椰、水椰等品种，椰林内大小l高矮、直曲的椰树参差错落，自然成林。', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867093916749824.png', '早八晚五', 600.00, '东郊椰林', '五星级景点', 'https://www.cncn.com/piao/hainan/'),
	('1613456814429573138', 'admin', '2023-01-12 16:44:15.829000', 0, NULL, NULL, '海口市', '乌托邦式的电影主题旅游胜地，展现了20世纪百年期间的中国城市街区的变迁，还有1942风情街、老北京风情街、南洋风情街、教堂广场区及全球最大的摄影棚等配套服务区，风格各异的中外建筑仿佛让人穿越，沿街有许多商铺和餐厅，还可以乘坐黄包车马车穿行其中。', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867085490393088.png', '早八晚五', 50.00, '华谊冯', '一星级景点', 'https://www.cncn.com/piao/hainan/'),
	('1613456814429573139', 'admin', '2023-01-12 16:44:15.829000', 0, NULL, NULL, '三亚市', '是我国唯一的猕猴自然保护区，现有猕猴1800多只，各类热带植物数百种，鸟类、兽类各有几十种，在这里乘客可以乘索道在空中饱览渔港风情，与弥猴同乐，上渔船看苗家风情，并品鲜活鱼排大餐。', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867080327204864.png', '早八晚五', 10.00, '南湾猴岛', '三星级景点', 'https://www.cncn.com/piao/hainan/'),
	('1613456814429573140', 'admin', '2023-01-12 16:44:15.829000', 0, NULL, NULL, '儋州市', '走进植物园就如同打开一本热带植物的百科全书，在海南葱葱的绿海，悠悠的果香，漫步期间很舒服。园内还可以免费品尝各种自研自产的咖啡，系列饮品和名茶。', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867083393241088.png', '早八晚五', 700.00, '兴隆热带植物园', '四星级景点', 'https://www.cncn.com/piao/hainan/'),
	('1613456814429573141', 'admin', '2023-01-12 16:44:15.829000', 0, NULL, NULL, '海口市', '位于三亚湾的东南端，是一座在大海礁盘之中的填出来人工岛。岛上的5栋酒店建筑恢宏前卫，是海面上最靓丽的风景线，坐落着超星级的酒店、国际游艇会和国际邮轮港，被誉为是东方的迪拜海上的度假天堂。', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867084538286080.png', '早八晚五', 20.00, '凤凰岛', '五星级景点', 'https://www.cncn.com/piao/hainan/');
